// components/ProductsList.js
import React, { useEffect, useState } from "react";
import { useAuthUser } from "../security/AuthContext";
import "../style/products.css";

export default function ProductsList() {
  const [products, setProducts] = useState([]);
  const [message, setMessage] = useState("");
  const { isAuthenticated } = useAuthUser();

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await fetch(`${process.env.REACT_APP_API_URL}/products`);
      if (response.ok) {
        const data = await response.json();
        setProducts(data);
      }
    } catch (error) {
      setMessage("Error fetching products");
    }
  };

  const handleAddToCart = async (productId) => {
    if (!isAuthenticated) {
      setMessage("Please login to add items to cart");
      setTimeout(() => setMessage(""), 3000);
      return;
    }

    try {
      const response = await fetch(`${process.env.REACT_APP_API_URL}/cart`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        credentials: "include",
        body: JSON.stringify({
          productId,
          quantity: 1,
        }),
      });
      if (response.ok) {
        setMessage("Product added to cart successfully!");
        setTimeout(() => setMessage(""), 3000);
      }
    } catch (error) {
      setMessage("Error adding product to cart");
      setTimeout(() => setMessage(""), 3000);
    }
  };

  const handleDelete = async (productId) => {
    if (!isAuthenticated) {
      setMessage("Please login to delete products");
      setTimeout(() => setMessage(""), 3000);
      return;
    }

    if (window.confirm("Are you sure you want to delete this product?")) {
      try {
        const response = await fetch(`${process.env.REACT_APP_API_URL}/products/${productId}`, {
          method: "DELETE",
          credentials: "include",
        });

        if (response.ok) {
          setMessage("Product deleted successfully!");
          fetchProducts(); // 重新加载产品列表
          setTimeout(() => setMessage(""), 3000);
        } else {
          setMessage("Error deleting product");
          setTimeout(() => setMessage(""), 3000);
        }
      } catch (error) {
        setMessage("Error deleting product");
        setTimeout(() => setMessage(""), 3000);
      }
    }
  };

  const handleDeleteAll = async () => {
    if (!isAuthenticated) {
      setMessage("Please login to delete products");
      setTimeout(() => setMessage(""), 3000);
      return;
    }

    if (window.confirm("Are you sure you want to delete ALL products? This action cannot be undone!")) {
      try {
        const response = await fetch(`${process.env.REACT_APP_API_URL}/products`, {
          method: "DELETE",
          credentials: "include",
        });

        if (response.ok) {
          setMessage("All products deleted successfully!");
          setProducts([]); // 清空产品列表
          setTimeout(() => setMessage(""), 3000);
        } else {
          setMessage("Error deleting products");
          setTimeout(() => setMessage(""), 3000);
        }
      } catch (error) {
        setMessage("Error deleting products");
        setTimeout(() => setMessage(""), 3000);
      }
    }
  };

  return (
    <div className="products-container">
      <div className="products-header">
        <h1>Products</h1>
        {isAuthenticated && (
          <button 
            className="delete-all-button"
            onClick={handleDeleteAll}
          >
            Delete All Products
          </button>
        )}
      </div>

      {message && <div className="message-toast">{message}</div>}

      <div className="products-grid">
        {products.map((product) => (
          <div key={product.id} className="product-card">
            <div className="product-info">
              <span className="product-name">{product.name}</span>
              <span className="product-price">${product.price.toFixed(2)}</span>
            </div>
            {product.description && (
              <p className="product-description">{product.description}</p>
            )}
            {product.category && (
              <span className="product-category">Category: {product.category}</span>
            )}
            <div className="product-actions">
              <button 
                className="add-to-cart-button"
                onClick={() => handleAddToCart(product.id)}
              >
                Add to Cart
              </button>
              {isAuthenticated && (
                <button 
                  className="delete-button"
                  onClick={() => handleDelete(product.id)}
                >
                  Delete
                </button>
              )}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
